import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    

    
    render() {
        return (
            <div>
                <p>{this.props.name}</p>
                <p>{this.props.email}</p>
                <p>{this.props.age}</p>

                
            </div>
        )
    }
}

export default ListOfPeople
